@vinothchandar TL;DR is the difference b/w `Row` and `InternalRow`:

 - When you do `df.rdd` you invoke deserializer which will deserialize internal binary representation (`UnsafeRow`) into a `Row` holding Java native types (it also holds the schema)

 - `df.queryExecution.toRdd` is an internal API that returns you an RDD of `InternalRow`s avoiding such conversion (thatâ€™s the primary reason for introduction of many utilities in `HoodieUnsafeUtils` to be able to access private Spark APIs)

